import React from "react";

const TransactionList = ({ transactionsOnDate }) => {
  console.log(transactionsOnDate);
  return (
    <div>
      {Object.keys(transactionsOnDate).map((index) => {
        <>
          <h2>{transactionsOnDate[index].amount}</h2>
          <h2>{transactionsOnDate[index].category}</h2>
          <h2>transactionsOnDate[index].note</h2>
          <h2>transactionsOnDate[index].type</h2>
        </>;
      })}
      <br />
    </div>
  );
};

export default TransactionList;
